import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the price filter section using its heading text (robust selector)
    await page.waitForSelector('//div[contains(@class,"price-filter")]//h4[contains(text(),"Price Range")]', { timeout: 10000 });

    // Focus on the min price input using placeholder attribute (different selector)
    const minPriceInput = await page.waitForSelector('input[placeholder="Min"]', { timeout: 5000 });
    await minPriceInput.click({ clickCount: 3 });
    await minPriceInput.fill('100');

    // Focus on the max price input using placeholder attribute (different selector)
    const maxPriceInput = await page.waitForSelector('input[placeholder="Max"]', { timeout: 5000 });
    await maxPriceInput.click({ clickCount: 3 });
    await maxPriceInput.fill('500');

    // Take screenshot after entering price range
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_price_range_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_price_range_filled.png'));

    // Click the "Apply" filter button using its text (different selector)
    const applyButton = await page.waitForSelector('//button[contains(@class,"apply-filter") and contains(text(),"Apply")]', { timeout: 5000 });
    await applyButton.click();

    // Wait for notification that filter was applied (using notification class and text)
    await page.waitForSelector('//div[contains(@class,"notification") and contains(text(),"Applied price filter")]', { timeout: 7000 });

    // Wait for the products grid/list to update (wait for at least one product with price in range)
    // We'll use a price cell in the product card as an anchor
    await page.waitForSelector('//div[contains(@class,"product-price") and contains(text(),"$")]', { timeout: 7000 });

    // Take screenshot after filter applied
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_price_filter_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_price_filter_applied.png'));

    // Extract the visible product titles and prices after filtering
    const products = await page.$$eval(
      'div.product-card, div.product-card-list',
      cards => cards.map(card => {
        const title = card.querySelector('.product-title')?.textContent?.trim() || '';
        const priceText = card.querySelector('.product-price')?.textContent || '';
        // Extract price using regex
        const priceMatch = priceText.match(/\$([\d,]+\.\d{2})/);
        const price = priceMatch ? parseFloat(priceMatch[1].replace(/,/g, '')) : null;
        return { title, price };
      })
    );

    // Filter extracted products to only those within 100-500 (should match UI)
    const filteredProducts = products.filter(p => p.price !== null && p.price >= 100 && p.price <= 500);

    return {
      success: true,
      action: "Applied price sort filter (100-500) and verified filtered product results.",
      extractedData: {
        filteredProducts
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
